import React from "react";

export default function HoverCounter() {
  const style = { backgroundColor: "#0000", color: "#fffff" };
  const { count, incrementCount } = this.props;
  return (
    <div onMouseOver={incrementCount} style={style}>
      <button>Hoverd {count} times</button>
    </div>
  );
}
